CREATE TABLE ISPLATE_RADNICIMA
(	
    MBR INTEGER, 
    MESEC VARCHAR2(32), 
    GODINA INTEGER,
    IZNOS NUMBER(10,2), 
    DATUM_ISPLATE DATE, 
    RAZLOG_ISPLATE VARCHAR(32),
    CONSTRAINT ISPLATE_RADNICIMA_PK PRIMARY KEY (MBR, DATUM_ISPLATE, RAZLOG_ISPLATE),
    CONSTRAINT ISPLATE_RADNICIMA_FK FOREIGN KEY (MBR) REFERENCES RADNIK (MBR),
    CONSTRAINT RAZLOG_ISPLATE_CH CHECK (RAZLOG_ISPLATE IN ('PLATA_DEO1', 'PLATA_DEO2', 'PUTNI_TROSKOVI', 'BONUS', 'DNEVNICA'))
);

commit;